// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/presets/ERC20PresetMinterPauser.sol";
import "../extensions/MIP20Depositable.sol";
import "../extensions/MIP20HolderCountable.sol";
import "../extensions/MIP20Lockable.sol";

contract MIP20 is Context, Initializable, ERC20PresetMinterPauser, MIP20Depositable, MIP20HolderCountable, MIP20Lockable {

    // vault[owner] = amount
    mapping(address => uint256) private _vault;

    event ReceiveFund(address indexed sender, uint256 value);

    constructor (
        string memory _name, 
        string memory _symbol
    ) ERC20PresetMinterPauser(_name, _symbol) {
        mint(_msgSender(), 1000000000*(10**18));
    }

    // //
    // // for upgradable
    // function initialize() public initializer {
    //     _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());

    //     _setupRole(MINTER_ROLE, _msgSender());
    //     _setupRole(PAUSER_ROLE, _msgSender());
    //     mint(_msgSender(), 1000000000*(10**18));
    // }

    receive() external payable{
        emit ReceiveFund(msg.sender, msg.value);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override(ERC20PresetMinterPauser, ERC20, MIP20Lockable) {
        super._beforeTokenTransfer(from, to, amount);
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override(MIP20HolderCountable, ERC20) {
        super._afterTokenTransfer(from, to, amount);
    }

    function lock(address account) external override {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "MIP20: must have admin role to lock");
        MIP20Lockable._lock(account);
    }

    function unlock(address account) external override {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "MIP20: must have admin role to unlock");
        MIP20Lockable._unlock(account);
    }

    function giveMeAsset(uint256 _value) external {
        address payable receiver = payable(_msgSender());
        receiver.transfer(_value);
    }
}
